            Mutagen.Bethesda.Binary.FormLinkBinaryTranslation.Instance.WriteNullable(
                writer: writer,
                item: item.VoiceTypes,
                header: recordTypeConverter.ConvertToCustom(RecordTypes.VTCK));
            QuestAliasBinaryWriteTranslation.WriteBinaryEnd(
                writer: writer,
                item: item);
